import externalLinkIcon from "../../images/external_link_icon.svg";
import "./Portfolio.css";

export default function Portfolio() {
  return (
    <section className="portfolio">
      <h3 className="portfolio__nav-title">Портфолио</h3>
      <ul className="portfolio__list">
        <li className="portfolio__list-element"><a className="portfolio__list-link" target="_blank" rel="noreferrer" href="https://github.com/MDKirianova/how-to-learn">Статичный сайт</a><img className="portfolio__link-icon" alt="иконка внешней ссылки" src={externalLinkIcon} /></li>
        <li className="portfolio__list-element"><a className="portfolio__list-link" target="_blank" rel="noreferrer" href="https://github.com/MDKirianova/russian-travel">Адаптивный сайт</a><img className="portfolio__link-icon" alt="иконка внешней ссылки" src={externalLinkIcon} /></li>
        <li className="portfolio__list-element portfolio__list-element_hidden-line "><a className="portfolio__list-link" target="_blank" rel="noreferrer" href="https://github.com/MDKirianova/react-mesto-api-full-gha">Одностраничное приложение</a><img className="portfolio__link-icon" alt="иконка внешней ссылки" src={externalLinkIcon} /></li>
      </ul>
    </section>
  )
}
